	"experience": "[{\"attributes\":{\"type\":\"Candidate_Employment_History__c\"},\"Employer__c\":\"DTCC\",\"Current_Indicator__c\":true,\"Job_Title__c\":\"Senior .Net Developer\",\"Country__c\":\"US\",\"State_Province__c\":\"NJ\",\"City__c\":\"Jersey City\",\"Employment_Description__c\":\"Description:\\nEducational Loan Financial Management System is a web based comprehensive software package supporting Student Financial Aid Administration, Loans and Reports. The system is modular and organized to support all of the functions of the Financial Aid Office like need analysis, evaluation, packaging, notification, disbursement, funds management, tracking, verification and reporting. This application completely web enabled the process of loan applying to loan repayment of a customer.\\nResponsibilities:\\n•\\tInvolved in full life cycle of software development like Requirement Analysis, Design, Implementation and Testing.\\n•\\tImplemented Model View View Model (MVVM) pattern in WPF/Silverlight windows presentation Foundation application using C#.Net.\\n•\\tInvolved in developing windows application using WinForms and WPF.\\n•\\tCreated Restful services using ASP.NET Web API for exposing these to end users.\\n•\\tEnhanced user experience by designing new web features using MVC Framework like Backbone.js.\\n•\\tWorked with Web API to provide services to HTTP requests.\\n•\\tInvolved in writing AngularJS and JavaScript in client side validations.\\n•\\tCreated customized UI web forms using HTML and JavaScript, AngularJS, ExtJS, date picker using Bootstrap and Developed Data Transfer Objects (DTO) in C# for business entities.\\n•\\tUsed Telerik controls like RadGrid, Rad Auto Complete Box, Data Forms, Bread Crumb, raddocking, etc. for an overall look and feel consistency and did prototyping on these controls.\\n•\\tResponsible for developing WCF Service for exchange of data between systems and implement business logic and used Restful API.\\n•\\tFollowed Agile Methodologies (