r all the documentation reviews\\n•\\tActively participated in unit testing of the application to ensure quality\\n•\\tMaintained version control using IBM Rational Clear Case.\\n•\\tExperienced in Onsite Offshore model coordinating with development/support activities.\\n\\nEnvironment: .NET Framework 1.1/2.0/3.5/4.0/4.5, Nlog, HTML, XML/XSL, SQL Server 2012, SharePoint 2010, Oracle 11g/12c, TFS, Git, C#.net, jQuery, AngularJS 1.x, Bootstrap 3, Design Driven Documentation, ADO.NET, Visual Studio 2012/2010/2008, WCF, WPF, MVVM, WEB API, Code Collaborator, IIS 7, LINQ, WPF/Silverlight, WinForms, SSRS, Clear Case, Agile/Scrum Software Methodology\",\"Start_Date__c\":\"2015-08-01\",\"Parse_Indicator__c\":true},{\"attributes\":{\"type\":\"Candidate_Employment_History__c\"},\"Employer__c\":\"Hospira\",\"Job_Title__c\":\"Senior .Net Developer\",\"Country__c\":\"US\",\"State_Province__c\":\"IL\",\"City__c\":\"Chicago\",\"Employment_Description__c\":\"Patient Care Record Suite is a comprehensive electronic medical record that supports clinicians in providing health care in the home setting and includes modules such as patient information, plan of care, and coordination of care, managed care and visit doc We tried to develop a health care application which is helpful for the better experience of patients.\\n\\nResponsibilities:\\n•\\tTranslate requirements to design, architect and document systems, and write code that is stable, reusable, scalable and simple.\\n•\\tVBA application development. UI design, revision and enhancement. Data validation.\\n•\\tDeveloping an application using ASP.NET MVC Razor forms (front end) and SQL Server 2012 stored procedures (backend).\\n•\\tWorking with an Agile, Scrum methodology to ensure delivery of high quality work with every monthly iteration.\\n•\\tUsing SSIS tools like Import and Export Wizard, Package Installation, and SSIS Package Designer.\\n•\\tFollowed Agile Methodologies (SCRUM) and Test Driven Development (TDD).\\n•\\tDeveloped 