tools that are included in SQL Server Analysis Services (SSAS), SignalR and Developed reports using SQL Server Reporting Services (SSRS).\\n•\\tWrote Stored Procedures to incorporate new Business logic.\\n•\\tUsed PL/SQL programs in writing Sql Server Stored Procedures and also written database triggers for various operations. Implemented Object Oriented Programming (OOPS) and understanding of software engineering practices in.NET for windows services development.\\n•\\tTesting of database, queries optimization and performance.\\n•\\tManaging templates and style sheets (CSS) using XAML.\\n•\\tDeveloping XML Schema, Extracting XML from Oracle DB, Parsing and creation of xml document in db to store Order and Customer related information.\\n•\\tExperience in using Source Code Control Systems like MS Visual Source Safe and Team Foundation Server (TFS) and Proficient in writing Unit Test Cases for Business logic.\\n•\\tIncorporated Information security throughout the software development life cycle.\\n•\\tUsed .NET 4.5 in creating a WCF Web-Authenticator.\\n•\\tGood knowledge in front end development using Oracle Forms6i/Reports6i/10g.\\n•\\tUsed WPF of .NET 4.5 for creating control templates and more appealing visual appearance.\\n\\nEnvironment: WPF, SILVERLIGHT, C#, SQL Server 2012 R2, Web Services, MVVM, Azure, Oracle, TFS, Git, SSIS, SSRS, SSAS, SSDT, Agile Development, Entity Framework, WebForms, AJAX Control Toolkit, SignalR, Enterprise Library 4.1, HTML, RIA, Silverlight4.0, IIS 7.0, Visual Studio 2012, OOPS, Object Oriented Methodology, CSS, XAML, XHMTL, Windows 8.1, XML, Web Services, WCF, WWF, .Net Framework 4.0/4.5, Microsoft Reporting Services (SSRS)\",\"Start_Date__c\":\"2012-04-01\",\"End_Date__c\":\"2014-08-31\",\"Current_Indicator__c\":false,\"Parse_Indicator__c\":true},{\"attributes\":{\"type\":\"Candidate_Employment_History__c\"},\"Employer__c\":\"Capgemini\",\"Job_Title__c\":\"NET Developer\",\"Employment_Description__c\":\"Responsibilities:\\nInvolve